// App.js
import React from 'react';
import Main from './Main';

function App() {
  return (
    <div>
      {/* 전역 헤더가 있다면 여기에 */}
      <header style={{ padding: '1rem', backgroundColor: '#f5f5f5' }}>
        <h1>D-Fund</h1>
      </header>

      {/* 메인 콘텐츠 */}
      <main>
        <Main />
      </main>

      {/* 전역 푸터가 있다면 여기에 */}
      <footer style={{ padding: '1rem', backgroundColor: '#eee', marginTop: '2rem' }}>
        <p>© 2024 D-Fund. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
